import React from "react";
import { SmileCoordinates } from "./types";

interface Props {
  image?: string;
  coords?: SmileCoordinates[];
}

const SmileViewer: React.FC<Props> = ({ image, coords }) => (
  <div className="card" style={{ maxWidth: "350px", margin: "0 auto" }}>
    <div className="card-body">
      {image ? (
        <img src={image} alt="Detected Smile" className="img-fluid mb-3" />
      ) : (
        <p className="text-center">No Image Available</p>
      )}
      <h5 className="card-title">Smile Coordinates</h5>
      {coords && coords.length > 0 ? (
        <div className="table-responsive">
          <table className="table table-bordered">
            <thead>
              <tr>
                <th>Property</th>
                <th>Value</th>
              </tr>
            </thead>
            <tbody>
              {coords.map((coord, index) => (
                <React.Fragment key={index}>
                  <tr>
                    <td>h</td>
                    <td>{coord.h}</td>
                  </tr>
                  <tr>
                    <td>w</td>
                    <td>{coord.w}</td>
                  </tr>
                  <tr>
                    <td>x</td>
                    <td>{coord.x}</td>
                  </tr>
                  <tr>
                    <td>y</td>
                    <td>{coord.y}</td>
                  </tr>
                </React.Fragment>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <p className="text-center">No smile detected</p>
      )}
    </div>
  </div>
);

export default SmileViewer;
